const styles = () => ({
  uploadLossDocumentsTitleContainer: {
    borderBottom: '3px dotted #0000001f',
    width: '100%'
  },
  uploadLossDocumentsTitle: {
    borderBottom: 0,
    marginBottom: 0,
    paddingBottom: 0,
  }
});

export default styles;
